// src/pages/Community/CommunityPage.js
import React from 'react';
import './CommunityPage.css';

const CommunityPage = () => {
  return (
    <div className="community-container">
      <h1>Community & Mentorship</h1>
      
      <div className="button-group">
        <button className="btn-discussion">Start a Discussion</button>
        <button className="btn-mentor">Find a Mentor</button>
      </div>

      <div className="search-input">
        <input type="text" placeholder="Search discussions or mentors" />
      </div>

      <div className="tabs">
        <button className="active">Discussions</button>
        <button>Mentors</button>
      </div>

      {/* Discussion List */}
      <div className="discussions">
        <div className="discussion-card">
          <h3>Tips for landing a software engineering internship?</h3>
          <p>Jessica Chen • Computer Science Student • 2 hours ago</p>
          <p>
            I'm a junior CS major looking for internship opportunities for next summer...
          </p>
        </div>
        {/* Add more discussion cards here */}
      </div>
    </div>
  );
};

export default CommunityPage;
